patch:
diff --git a/Modules/_sre/sre.c b/Modules/_sre/sre.c
index 3f11916f9e1..d8c35f7d7c5 100644
--- a/Modules/_sre/sre.c
+++ b/Modules/_sre/sre.c
@@ -1544,11 +1544,24 @@ _sre_template_impl(PyObject *module, PyObject *pattern, PyObject *template)
     for (Py_ssize_t i = 0; i < n; i++) {
         Py_ssize_t index = PyLong_AsSsize_t(PyList_GET_ITEM(template, 2*i+1));
         if (index == -1 && PyErr_Occurred()) {
+            /* Clean up only initialized items */
+            for (Py_ssize_t j = 0; j < i; j++) {
+                Py_CLEAR(self->items[j].literal);
+            }
+            Py_CLEAR(self->literal);
+            Py_SET_SIZE(self, i);
             Py_DECREF(self);
             return NULL;
         }
         if (index < 0) {
-            goto bad_template;
+            /* Clean up only initialized items */
+            for (Py_ssize_t j = 0; j < i; j++) {
+                Py_CLEAR(self->items[j].literal);
+            }
+            Py_CLEAR(self->literal);
+            Py_SET_SIZE(self, i);
+            Py_DECREF(self);
+            goto bad_template_end;
         }
         self->items[i].index = index;

@@ -1566,7 +1579,7 @@ _sre_template_impl(PyObject *module, PyObject *pattern, PyObject *template)

 bad_template:
     PyErr_SetString(PyExc_TypeError, "invalid template");
-    Py_XDECREF(self);
+bad_template_end:
     return NULL;
 }
